import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import MediaQuery from 'react-responsive';
import MaterialIcons from 'material-icons-react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import '../font.css';

class Head extends React.Component {
    render(){
        return (
                <Navbar collapseOnSelect expand="md" bg="light" fixed="top">                    
                        <Navbar.Brand href="#">
                            <MediaQuery query="(min-device-width : 768px)">
                                <img
                                src={process.env.PUBLIC_URL + 'images/favicon.png'}
                                alt="NITRAA PUNE"
                                className="d-inline-block align-top"
                                width="50"
                                height="50"
                                />
                                <Navbar.Text style={
                                    {fontFamily: 'Anton', paddingLeft: 20, fontSize:30}
                                    }>
                                        NITRAA | PUNE
                                </Navbar.Text>
                            </MediaQuery>
                            <MediaQuery query="(max-device-width : 768px)">
                                <img
                                src={process.env.PUBLIC_URL + 'images/favicon.png'}
                                alt="NITRAA PUNE"
                                className="d-inline-block align-top"
                                width="40"
                                height="40"
                                />
                                <Navbar.Text style={
                                    {fontFamily: 'Anton', paddingLeft: 60, fontSize:20}
                                    }>
                                        NITRAA | PUNE
                                </Navbar.Text>
                            </MediaQuery>
                        </Navbar.Brand>
                        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                        <Navbar.Collapse id="responsive-navbar-nav">
                            <Nav className="mr-auto">
                            <Nav.Link href="#features">
                                <Row>
                                    <Col>
                                        <MaterialIcons icon="people"/> About Us
                                    </Col>
                                </Row>
                            </Nav.Link>
                            <Nav.Link href="#pricing">
                                <Row>
                                    Community
                                </Row>
                            </Nav.Link>
                            <NavDropdown title="Initiatives" id="collasible-nav-dropdown">
                                <NavDropdown.Item href="#action/3.1">Events</NavDropdown.Item>
                                <NavDropdown.Divider />
                                <NavDropdown.Item href="#action/3.2">Careers</NavDropdown.Item>
                                <NavDropdown.Divider />
                                <NavDropdown.Item href="#action/3.3">Benefit Projects</NavDropdown.Item>
                            </NavDropdown>
                            </Nav>
                            <Nav>
                            <Nav.Link href="#deets">Alumni Nearby</Nav.Link>
                            <Nav.Link href="#memes">Login</Nav.Link>
                            </Nav>
                        </Navbar.Collapse>
                </Navbar>
        );
    }
}

export default Head;
